ControlPropertyState.AutoRuleBindingString:
Set(
    varItem,
    ThisItem
);
Navigate(
    TicketsDetailPage_User,
    ScreenTransition.Fade
);
Set(
    counter,
    true
)

ForAll(
    TicketsGallery_1.AllItems,
    Collect(
        colAllitem,
        {
            Title: ThisRecord.Title,
            Created: Text(
                ThisRecord.Created,
                "dd/mm/yy"
            ),
            'Created By': ThisRecord.'Created By'.Email,
            Status: ThisRecord.Status.Value
        }
    )
);
Set(
    varLinkDocument,
    ExportExcel.Run(
        JSON(
            colAllitem,
            JSONFormat.IncludeBinaryData & JSONFormat.IgnoreUnsupportedTypes
        )
    ).varlink
);
Launch(varLinkDocument);
Clear(colAllitem)

Set(
    varItem,
    ThisItem
);
Navigate(
    TicketsDetailPage_User,
    ScreenTransition.Fade
);
Set(
    counter,
    true
)
